// src/UserProgressByRuleTree.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserProgressByRuleTree = () => {
  const [progress, setProgress] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const username = 'SessionMShared';
      const password = 'g7oaMlJDxR9CE1XkGn7mR8iXaLMu9Fyd';
      const token = btoa(`${username}:${password}`);

      try {
        const response = await axios.get('https://domains-connecteast1.ent-sessionm.com/incentives/api/1.0/progress/rule_tree/user_progress', {
          headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
            'Authorization': `Basic ${token}`
          },
          params: { userId: 'dcd393fe-3ff0-11ef-8048-69e7ac110003', ruleTreeId: 'c45c9b1b-8859-4012-96b8-4f7159b7d1ac' }, // Replace with actual IDs
        });
        setProgress(response.data);
      } catch (error) {
        setError(error);
      }
    };

    fetchData();
  }, []);

  if (error) return <div>Error: {error.message}</div>;
  if (!progress) return <div>Loading...</div>;

  return (
    <div>
      <h1>User Progress By Rule Tree</h1>
      <pre>{JSON.stringify(progress, null, 2)}</pre>
    </div>
  );
};

export default UserProgressByRuleTree;
